import logo from '../logo.svg';
import '../App.css';

function Art(props) {

    let artistName = "";
    let artURL = "";
    let artTitle = "";

    if(props.data != null) {
        artistName = props.data.artistDisplayName;
        artURL = props.data.primaryImag;
        artTitle = props.data.title;
        console.log("Art ", artURL, artistName, artTitle);
    }

    return (
        <div className="App">
        <header className="App-header">
            <img src={ artURL } className="App-logo" alt="logo" />
            <p>{ artTitle }</p>
            <p>{ artistName } </p>
        </header>
        </div>
    );
}

export default Art;
